import React from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

function LoginPage() {
  const handleLogin = () => {
    // Add your login logic here
    console.log('Login button clicked');
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '20px' }}>
      <TextField id="filled-username" label="Username" variant="filled" margin="normal" />
      <TextField id="filled-password" label="Password" type="password" variant="filled" margin="normal" />
      <Button variant="contained" color="primary" onClick={handleLogin} style={{ marginTop: '20px' }}>
        Login
      </Button>
    </div>
  );
}

export default LoginPage;
